<li><strong>输出编码</strong>：在将用户输入的数据插入到 HTML 中时，需要对特殊字符进行编码。例如，你可以将 <code>&lt;</code> 替换为 <code>&amp;lt;</code>，将 <code>&gt;</code> 替换为 <code>&amp;gt;</code>，将 <code>"</code> 替换为 <code>&amp;quot;</code>，将 <code>'</code> 替换为 <code>&amp;#x27;</code>，将 <code>/</code> 替换为 <code>&amp;#x2F;</code>。这样，即使用户输入的数据包含有恶意的 JavaScript 代码，这些代码也不会被浏览器执行。</li>
